import React from "react";

export default function profile() {
  return (
    <div>
      <div class="item">
        <img
          class="ui mini circular image"
          src="src\assets\profile.png"
        />
        <div class="content">
          <div class="ui sub header">Elyse</div>
          Developer
        </div>
      </div>
    </div>
  );
}
